import { Container } from "react-bootstrap";

import ICONS from "./identifyIssue/icons";

import Steps from "./identifyIssue/steps";

function App() {

  return (
    <Container>
  <i className="bi-alarm"></i>
      {ICONS.threedots}
      <Steps/>
    </Container>
  );
}

export default App;
